import Box from "@mui/material/Box";
import Grid from "@mui/material/Grid";
import TextField from "@mui/material/TextField";
import Autocomplete from "@mui/material/Autocomplete";
import { useState, useEffect } from "react";
import FormControl from "@mui/material/FormControl";
import InputLabel from "@mui/material/InputLabel";
import Input from "@mui/material/Input";
import InputAdornment from "@mui/material/InputAdornment";
import { margin } from "@mui/system";
import DropFileInput from "../components/drop-file-input/DropFileInput";
const AddImage = () => {
  const product = [
    {
      id: 1,
      product_name: "Giày cổ thấp",
    },
    {
      id: 2,
      product_name: "Giày đinh",
    },
  ];
  const [productID, setProductID] = useState('')
  console.log(productID);
  const onFileChange = (files) => {
    files.map(file => {
      let image_color = file.name
      const data = { productID, image_color}
      // Fetch API
      console.log(data);
    })
  };
  return (
    <>
    <div>
      <h2 className="page-header">Add Image</h2>
      <div className="row">
        <div className="col-12">
          <div className="card">
            <div className="card__body">
              <Box sx={{ flexGrow: 1 }}>
                <Grid container spacing={2}>
                  <Grid item xs={8}>
                    <div className="box">
                      <DropFileInput onFileChange={onFileChange} />
                    </div>
                  </Grid>
                  <Grid item xs={4}>
                    <Autocomplete
                        onChange={(event, newValue) => {
                            setProductID(newValue === null ? null : newValue.id)
                        }}
                      id="controllable-states-demo"
                      getOptionLabel={(product) => `${product.product_name}`}
                      options={product}
                      sx={{ width: "100%", background: "#fff" }}
                      isOptionEqualToValue={(option, value) =>
                        option.id === value.id
                      }
                      noOptionsText={"NO BRAND"}
                      renderOption={(props, product) => (
                        <Box component="li" {...props} key={product.id}>
                          {product.product_name}
                        </Box>
                      )}
                      renderInput={(params) => (
                        <TextField {...params} label="Products" />
                      )}
                    />
                  </Grid>
                </Grid>
              </Box>
            </div>
          </div>
        </div>
      </div>
    </div>
    <div>
      <h2 className="page-header">Add Image Detail</h2>
      <div className="row">
        <div className="col-12">
          <div className="card">
            <div className="card__body">
              <Box sx={{ flexGrow: 1 }}>
                <Grid container spacing={2}>
                  <Grid item xs={8}>
                    <div className="box">
                      <DropFileInput onFileChange={onFileChange} />
                    </div>
                  </Grid>
                  <Grid item xs={4}>
                    <Autocomplete
                        onChange={(event, newValue) => {
                            setProductID(newValue === null ? null : newValue.id)
                        }}
                      id="controllable-states-demo"
                      getOptionLabel={(product) => `${product.product_name}`}
                      options={product}
                      sx={{ width: "100%", background: "#fff" }}
                      isOptionEqualToValue={(option, value) =>
                        option.id === value.id
                      }
                      noOptionsText={"NO BRAND"}
                      renderOption={(props, product) => (
                        <Box component="li" {...props} key={product.id}>
                          {product.product_name}
                        </Box>
                      )}
                      renderInput={(params) => (
                        <TextField {...params} label="Products" />
                      )}
                    />
                  </Grid>
                </Grid>
              </Box>
            </div>
          </div>
        </div>
      </div>
    </div>
    </>
  );
};
export default AddImage;
